import React from "react";

const Header = () => {
  return (
    <div className="row navbar_upper">
      <div className="col-lg col-md social_sets ml-4">
        <div className="facebook">FACEBOOK</div>
      </div>
      <div className="col-lg col-md social_sets">
        <div className="facebook">INSTAGRAM</div>
      </div>
      <div className="col-lg col-md social_sets">
        <div className="facebook">TWITTER</div>
      </div>
      <div className="col-lg col-md social_sets">
        <div className="facebook">TELEGRAM</div>
      </div>
      <div className="col-lg col-md social_sets">
        <div className="facebook">GMAIL</div>
      </div>
    </div>
  );
};

export default Header;
